import * as React from "react";
import { Card } from "react-bootstrap";
import logo from "../../assets/image/errImg.png";

export default function Detail({ data }) {
  return (
    <div
      style={{
        width: "auto",
        height: 250,
        marginBottom: 16,
      }}
    >
      <Card>
        <Card.Img variant="top" src={logo} style={{ border: "0.8px solid #E0E0E5" }} />
      </Card>
      <p>Product Detail</p>
    </div>
  );
}
